export function paginate(items, pageNumber, pageSize) {
    const startIndex = (pageNumber - 1) * pageSize;
    return [...items].splice(startIndex, pageSize);
};

export function renderPersonLetterEnd(qtyOfPerson) {
    const lastDigit = Number(qtyOfPerson.toString().slice(-1));
    const lastTwoDigit = Number(qtyOfPerson.toString().slice(-2));
    if ([2, 3, 4].includes(lastDigit)) {
        if ([12, 13, 14].includes(lastTwoDigit)) return "";
        return "а";
    } else {
        return ""
    }
};

export function renderActionLetterEnd(qtyOfPerson) {
    const lastDigit = Number(qtyOfPerson.toString().slice(-1));
    const lastTwoDigit = Number(qtyOfPerson.toString().slice(-2));
    if ([2, 3, 4].includes(lastDigit)) {
        if ([12, 13, 14].includes(lastTwoDigit)) return "ет"
        return "ут";
    } else {
        return "ет";
    }
};
